//import ContactPage from "./ContactPage";

const App = () => {
  return (
    <div>
      <header>HELLO</header>
      console
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
            </ul>
          </nav>
          <Route path="/" exact component={HomePage} />
        </div>
      </Router>
    </div>
  );
};

export default App;
